import React, { useState } from "react";
import { Box, Paper, Typography, Tabs, Tab, useTheme } from "@mui/material";
import { useForm } from "react-hook-form";

import BasicStaffDataGrid from "../../components/Staffs/StaffsCreate/DataGrids/BasicStaffDataGrid";
import FormFooter from "../../components/Staffs/StaffsCreate/FormFooter";
import TabContext from "../../components/Staffs/StaffsCreate/Tabs/TabContext";
import StaffTabs from "../../components/Staffs/StaffsCreate/Tabs/StaffTabs";

const StaffCreate = () => {
  const theme = useTheme();
  const {
    register,
    handleSubmit,
    control,
    formState: { errors },
  } = useForm();

  const onSubmit = (data) => {
    // eslint-disable-next-line no-console
    console.log(data);
  };

  const [tabValue, setTabValue] = useState(0);

  const handleTabChange = (event, newTabValue) => {
    setTabValue(newTabValue);
  };

  return (
    <Box component="form" autoComplete="off" onSubmit={handleSubmit(onSubmit)}>
      <Box sx={{ display: "flex", justifyContent: "center", m: 1 }}>
        <Typography variant="h2" fontWeight="700">
          Στοιχεία Προσωπικού
        </Typography>
      </Box>
      <Paper sx={{ width: "50vw", m: 4 }} elevation={8}>
        <StaffTabs handleTabChange={handleTabChange} tabValue={tabValue} />
        <TabContext tabValue={tabValue} index={0}>
          <BasicStaffDataGrid
            control={control}
            errors={errors}
            register={register}
          />
        </TabContext>
        <FormFooter />
      </Paper>
    </Box>
  );
};

export default StaffCreate;
